import { Cursors } from './cursors';
export type PaginatedData = QueryOffsetPaginationData | QueryCursorPaginationData;
export interface QueryOffsetPaginationData {
    elementsCount: number;
    totalCount: number;
}
export interface QueryCursorPaginationData {
    elementsCount: number;
    totalCount: number;
    cursors: Cursors;
}
